OES) and Current Employment Statistics (CES) programs. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"INDUSTRYUNEMPRT_CY":{"type":"number","alias":"2023 Unemployment Rate","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Unemployment Rate of Population Age 16+ in the geographic area. The Unemployment Rate represents the total number of unemployed persons as a percentage of the Civilian Labor Force. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"INDUSTRYUNEMP_CY":{"type":"number","alias":"2023 Unemployed Population 16+","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Unemployed Population Age 16+ in the geographic area. Unemployed Population include those who are not on active duty in the Armed Forces, neither currently working nor waiting to work a job they hold, and have actively sought employment during the past four weeks and are available to work if hired; includes temporarily laid off employees. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKTOTPOP_CY":{"type":"number","alias":"2023 Total Population","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSMEDAGE_CY":{"type":"number","alias":"2023 Median Age","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKTOTHH_CY":{"type":"number","alias":"2023 Total Households","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHMEDDI_CY":{"type":"number","alias":"2023 Median Disposable Income","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Disposable Income in the geographic area. Disposable Income represents money after taxes and provides an estimate of a household's purchasing power. Four types of taxes are deducted: federal individual income taxes, state individual income taxes, FICA (Social Security) and federal retirement payroll taxes, and property taxes for owner-occupied housing. Median Disposable Income divides disposable income distribution into two equal groups; half the population has disposable income higher than the median, and half lower. If the median is $200,000+, it is represented by a value of $200,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Population","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSHHGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Households","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSFAMGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Families","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Families: Compound Annual Growth Rate (CAGR). The Families CAGR is an annualized measure that describes orName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HEALTHMEDHINC_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPCI_CY":{"id":"PCI_CY","fullName":"KeyUSFacts.PCI_CY","alias":"2023 Per Capita Income","fieldName":"KEYUSFACTSPCI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPCI_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Per Capita Income in the geographic area. Per Capita Income is calculated by dividing Aggregate Income by the Total Population for the area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHMEDNW_CY":{"id":"MEDNW_CY","fullName":"Wealth.MEDNW_CY","alias":"2023 Median Net Worth","fieldName":"WEALTHMEDNW_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHMEDNW_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.OCCUPATIONOCCMGMT_CY":{"id":"OCCMGMT_CY","fullName":"occupation.OCCMGMT_CY","alias":"2023 Occupation: Management (Esri)","fieldName":"OCCUPATIONOCCMGMT_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.OCCUPATIONOCCMGMT_CY","type":"esriFieldTypeDouble","vintage":null,"source":null},"dataCollectionsCalculator.OCCUPATIONOCCBUS_CY":{"id":"OCCBUS_CY","fullName":"occupation.OCCBUS_CY","alias":"2023 Occupation: Business/Financial (Esri)","fieldName":"OCCUPATIONOCCBUS_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.OCCUPATIONOCCBUS_CY","type":"esriFieldTypeDouble","vintage":null,"source":null},"dataCollectionsCalculator.OCCUPATIONOCCCOMP_CY":{"id":"OCCCOMP_CY","fullName":"occupation.OCCCOMP_CY","alias":"2023 Occupation: Computer/Mathematical (Esri)","fieldName":"OCCUPATIONOCCCOMP_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.OCCUPATIONOCCCOMP_CY","type":"esriFieldTypeDouble","vintage":null,"source":null},"dataCollectionsCalculator.OCCUPATIONOCCARCH_CY":{"id":"OCCARCH_CY","fullName":"occupation.OCCARCH_CY","alias":"2023 Occupation: Architecture/Engineering (Esri)","fieldName":"OCCUPATIONOCCARCH_CY","precision":0,"ca
